import { getConnection } from "./../database/database";

const getProductos = async (req, res) => {
    try {
        const connection = await getConnection();
        const [result] = await connection.query(`
                SELECT PR.id_producto, CA.nom_subcat, MA.nom_marca, PR.descripcion, PR.undm, PR.estado_producto
                FROM producto PR
                INNER JOIN marca MA ON MA.id_marca = PR.id_marca
                INNER JOIN sub_categoria CA ON CA.id_subcategoria = PR.id_subcategoria
            `);
        res.json({data: result, message: "Productos listados"});
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

const getProducto = async (req, res) => {
    try {
        const { id } = req.params;
        const connection = await getConnection();
        const [result] = await connection.query(`
                SELECT PR.id_producto, CA.nom_subcat, MA.nom_marca, PR.descripcion, PR.undm, PR.estado_producto
                FROM producto PR
                INNER JOIN marca MA ON MA.id_marca = PR.id_marca
                INNER JOIN sub_categoria CA ON CA.id_subcategoria = PR.id_subcategoria
                WHERE PR.id_producto = ?`, id);
        
        if (result.affectedRows === 0) {
            return res.status(404).json({data: result, message: "Producto no encontrado"});
        }

        res.json({data: result, message: "Producto encontrado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

const addProducto = async (req, res) => {
    try {
        const { id_marca, id_subcategoria, descripcion, undm, estado_producto } = req.body;

        if (id_marca === undefined || id_subcategoria === undefined || descripcion === undefined || undm === undefined || id_subcategoria === undefined || estado_producto === undefined) {
            res.status(400).json({ message: "Bad Request. Please fill all field." });
        }

        const producto = { id_marca, id_subcategoria, descripcion, undm, estado_producto };
        const connection = await getConnection();
        await connection.query("INSERT INTO producto SET ? ", producto);

        res.json({ message: "Producto aadido" });
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

const updateProducto = async (req, res) => {
    try {
        const { id } = req.params;
        const { id_marca, id_subcategoria, descripcion, undm, estado_producto } = req.body;

        if (id_marca === undefined || id_subcategoria === undefined || descripcion === undefined || undm === undefined || id_subcategoria === undefined || estado_producto === undefined) {
            res.status(400).json({ message: "Bad Request. Please fill all field." });
        }

        const producto = { id_marca, id_subcategoria, descripcion, undm, estado_producto };
        const connection = await getConnection();
        const [result] = await connection.query("UPDATE producto SET ? WHERE id_producto = ?", [producto, id]);

        if (result.affectedRows === 0) {
            return res.status(404).json({code: 0, message: "Producto no encontrado"});
        }

        res.json({code: 1 ,message: "Producto modificado"});
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

const deleteProducto = async (req, res) => {
    try {
        const { id } = req.params;
        const connection = await getConnection();
        
        // Verificar si el producto existe dentro de una Nota de Ingreso
        const [verify] = await connection.query("SELECT 1 FROM detalle_nota WHERE id_producto = ?", id);

        if (verify.affectedRows === 0) {
            const producto = { estado_producto };
            const connection = await getConnection();
            const [result] = await connection.query("UPDATE producto SET ? WHERE id_producto = ?", [producto, id]);

            if (result.affectedRows === 0) {
                return res.status(404).json({code: 0, message: "Producto no encontrado"});
            }

            res.json({code: 2 ,message: "Producto dado de baja"});
        } else {
            const [result] = await connection.query("DELETE FROM producto WHERE id_producto = ?", id);
                
            if (result.affectedRows === 0) {
                return res.status(404).json({code: 0, message: "Producto no encontrado"});
            }

            res.json({code: 1 ,message: "Producto eliminado"});
        }
        
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

export const methods = {
    getProductos,
    getProducto,
    addProducto,
    updateProducto,
    deleteProducto
};

